    };
  }
  render() {
    return <div className = 'todoApp'>
        <div className = 'inputDiv'>
            <label>Enter your todo item</label>
            <input type = 'text'/>
        </div>
        <div className = 'inputDiv'>
            <label>Due date</label>
            <input type = 'date'/>
        </div>

    </div>;
  }
}
